import QuoteForm from './../components/quotes/QuoteForm'
import { useHistory } from 'react-router';

const NewQuotes = () =>{
  const history = useHistory();
    const addHandler=(props)=>{
        console.log(props);
        
        history.push('/quotes');
    }
  return  <>
    <QuoteForm onAddQuote={addHandler}/>
  </>
};
export default NewQuotes;
